window.bookSummaryJSON = "<p>When Joe Ledger and Echo Team rescue a group of American college kids held hostage in Iran, the Iranian government then asks them to help find six nuclear bombs planted in the Mideast oil fields. These stolen WMDs will lead Joe and Echo Team into hidden vaults of forbidden knowledge, mass-murder, betrayal, and a brotherhood of genetically-engineered killers with a thirst for blood. </p> <p>Accompanied by the beautiful assassin called Violin, Joe follows a series of clues to find the Book of Shadows, which contains a horrifying truth that threatens to shatter his entire worldview. They say the truth will set you free… Not this time. The secrets of the Assassin’s Code will set the world ablaze.</p>"; 
